#toDoListParent {
  width: 500px;
  margin-left: calc(50% - 250px);
  /* width: 70vw; */
}

.taskItem {
  background-color: #fff;
  color: black;
  height: 30px;
  width: 100%;
  border: 1px solid black;
  margin-bottom: 5px;
  text-align: center;
  font-size: 20px;
  transition: 0.3s;
}

.taskItem:hover {
  transition: 0.3s;
  cursor: pointer;
}

h1 {
  color: #fff;
  font-weight: bolder;
}

.task-complete {
  background-color: black;
  color: gray;
}
